import { ItemsMenuStyles } from './ItemsMenuStyles';
import MenuLink from './MenuLink';


export default function ItemsMenu ({products}) {
  console.log(products)
  return (
    <ItemsMenuStyles>
      <div className="menu-links">
        products.map(product => (
          <MenuLink prod/>
        ))
      </div>
    </ItemsMenuStyles>
  )
}
